import React from 'react'

export default function Card(props) {
    let options=props.options;
    let priceOptions=Object.keys(options)
    return (
        <div>
            <div>
                <div className="card mt-3" style={{ "width": "18rem", "maxHeight": "360px" }}>
                    <img className="card-img-top" src={props.imgSrc} alt="Card image cap" />
                    <div className="card-body">
                        <h5 className="card-title">{props.foodName}</h5>
                        {/* <p className="card-text">on the card title card's content.</p> */}
                        <div className="container w-100">
                            <select name="" id="" className="m-2 h-70 bg-success rounded">
                                {
                                    Array.from(Array(6), (e, i) => {
                                        return (
                                            <option key={i + 1} value={(i + 1)}>{i + 1}</option>
                                        )
                                    })
                                }
                            </select>
                            <select name="" id="" className="m-2 h-70 bg-success rounder">
                                {priceOptions.map((data)=>{
                                    return <option key={data} value={options.key}/>
                                })}
                                {/* <option value="half">Half</option>
                                <option value="full">Full</option> */}
                            </select>
                            <div className='d-inline h-100'>
                                Total Price
                            </div>

                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
